        static void Calibracion(double[,] arreglo, double sf)
        {
            //sf = Scaling Factor
            double escala;
            for (int i = 0; i < (arreglo.Length / 3); i++)
            {
                for (int j = 0; j < 3; j++)
                {
                    escala = Math.Round(arreglo[i, j] * sf, 6);
                    arreglo[i, j] = escala;
                    Console.Write(arreglo[i, j] + " ");
                }
                Console.WriteLine();
            }
            Console.WriteLine();
        }
